import React from 'react';
import elementContact from '../src/components/Contact';
import './App.css';

function App() {
  return (
    <div className="App">
      <elementContact
        name="Peter Palmer"
        avatar="https://randomuser.me/api/portraits/men/85.jpg"
      />
    </div>
  );
}
export default App;
